import React from 'react';
import './expense_card.css';

const expense_card = props => {
  var date = null;
  var description = null;
  var amount = null;
  var receiptImgLink = null;
  var category = null;
  var tag = null;
  var comments = null;
  var receiptIcon = "https://png.pngtree.com/png-vector/20190411/ourlarge/pngtree-vector-receipt-icon-png-image_927096.jpg";
  var receiptImg;

  if (receiptImgLink != null) {
    receiptImg = receiptImgLink
  } else {
    receiptImg = receiptIcon
  }

  return (
      <div className="Card">
        <p>{date}</p>
        <p>description</p>
        <p>amount</p>
        <img src={receiptImg}></img>
        <p>category</p>
        <p>tag</p>
        <p>comments</p>
      </div>
  )
}

export default expense_card;
